import React from "react";
import { Projects } from "../components/Projects";
import { useParams } from "react-router-dom";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";

function ProjectInfo() {
  const projectId = useParams().projectId;
  const project = Projects[projectId];
  return (
    <div className="project-display">
      <p className="subtitle">{project.name}</p>
      <div style={{ display: "flex", justifyContent: "center" }}>
        <Container fluid={true}>
          <p style={{ padding: "32px" }}>{project.description}</p>
          <Row className="justify-content-center">
            <Col md={7} xs={10}>
              <img
                style={{ padding: 0 }}
                className="project-screenshot"
                src={project.screenshot}
                alt=""
              />
            </Col>
            <Col md={5} xs={10} className="motivation-wrapper">
              <p>Motivation: {project.motivation}</p>
            </Col>
          </Row>
          <Row>
            <p style={{ padding: "32px" }}>Tools used: {project.tools}</p>
          </Row>
          <Row>
            <img
              className="project-screenshot"
              src={project.screenshot}
              alt=""
            />
          </Row>
        </Container>
      </div>
    </div>
  );
}

export default ProjectInfo;
